use std::collections::{HashSet, HashMap};

#[derive(Debug)]
struct Solution {}

fn collect_chars(s: &String) -> HashMap<u8, usize> {
  s
    .bytes()
    .collect::<HashSet<u8>>()
    .into_iter()
    .collect::<Vec<u8>>()
    .iter()
    .enumerate()
    .map(|(i, &x)| (x, i))
    .collect()
}

fn is_valid(sums: &Vec<Vec<usize>>, char_cnt: usize, i: usize, j: usize, k: usize) -> bool {
  let mut cnt = 0;
  for m in 0..char_cnt {
    if sums[i][m] < sums[j][m] { 
      cnt += 1;
      if cnt > k {
        return false;
      }
    }
  }
  true
}

fn binary_search(s: &String, sums: &Vec<Vec<usize>>, char_cnt: usize, start: usize, k: usize, i: usize, j: usize) -> usize {

  
  if i >= j {
    return i.min(j);
  }
  if i + 1 == j {
    if is_valid(sums, char_cnt, start, j, k) {
      return j;
    } else {
      return i;
    }
  }

  let m = (i + j) / 2;
  if is_valid(sums, char_cnt, start, m, k) {
    binary_search(s, sums, char_cnt, start, k, m, j)
  } else {
    binary_search(s, sums, char_cnt, start, k, i, m-1)
  }
}

impl Solution {
    pub fn length_of_longest_substring_k_distinct(s: String, k: i32) -> i32 {
      let k = k as usize;
      if s.len() <= k {
        return s.len() as i32;
      }
      
      let all_chars = collect_chars(&s);
      let char_cnt = all_chars.len();
      let idx = |b: u8| *all_chars.get(&b).unwrap();
      if char_cnt <= k {
        return s.len() as i32;
      }
      
      let mut sum = vec![0; char_cnt];
      let mut sums = vec![sum.clone()];
      let bytes: Vec<u8> = s.bytes().collect();
      for b in bytes {
        sum[idx(b)] += 1;
        sums.push(sum.clone());
      } 

      let mut max_ret = 0;
      for i in 0..sums.len() {
        if i + max_ret >= sums.len() {
          break;
        }
        if max_ret > 0 && !is_valid(&sums, char_cnt, i, i + max_ret, k)  {
          continue;
        }

        let j = binary_search(&s, &sums, char_cnt, i, k, i + max_ret, sums.len() - 1);
        max_ret = max_ret.max(j - i);
      }

      max_ret as i32
    }
}


#[test]
fn test() {
  let s = "aac"; 
  let k = 1;
  assert_eq!(Solution::length_of_longest_substring_k_distinct(s.to_string(), k), 2);

  let s = "eceba"; 
  let k = 2;
  assert_eq!(Solution::length_of_longest_substring_k_distinct(s.to_string(), k), 3);

  let s = "aa"; 
  let k = 1;
  assert_eq!(Solution::length_of_longest_substring_k_distinct(s.to_string(), k), 2);

  let s = "a"; 
  let k = 2;
  assert_eq!(Solution::length_of_longest_substring_k_distinct(s.to_string(), k), 1);

  let s = "a@b$5!a8alskj234jasdf*()@$&%&#FJAvjjdaurNNMa8ASDF-0321jf?>{}L:fh";
  let k = 10;
  assert_eq!(Solution::length_of_longest_substring_k_distinct(s.to_string(), k), 14);

  let s = "";
  let k = 2;
  assert_eq!(Solution::length_of_longest_substring_k_distinct(s.to_string(), k), 17);
}